import styled from "styled-components";
//import Check from "../Img/ei_check.svg";

const TodoList = styled.li`
  display: flex;
  width: 100%;
  height: 100px;
  min-height: 100px;
  background: var(--white);
  padding: 1rem;
  gap: 1rem;

  > span {
    font-weight: 300;
  }
`;

const ColorBox = styled.div`
  width: 5px;
  background-color: ${(prop) => prop.color || "var(--line-gray)"};
`;

const ListBody = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  gap: 1rem;
  span {
    font-weight: 600;
    font-size: 20px;
  }

  .tag {
    display: flex;
    gap: 1rem;
    span {
      font-size: var(--small-size);
      white-space: nowrap;
    }
  }
`;

export default function TodoLi(props: { time: string }) {
  return (
    <TodoList>
      <span>{props.time + "시"}</span>
      <ColorBox />
      <ListBody></ListBody>
    </TodoList>
  );
}
